&lt;b&gt;2 Burner Dual Fuel Stove&lt;/b&gt;Cook breakfast, lunch and dinner in any weather on the Coleman Guide Series Dual Fuel Stove. The cooking surface fits two 10-inch pans simultaneously above two Band-a-Blu burners that deliver a total 14,000 BTUs of cooking power. With Dual Fuel Technology, which gives you the option of using Coleman Liquid Fuel or unleaded gasoline, you can take less fuel with you to save money and packing space. WindBlock panels help shield your flame from wind and can adjust in and out to fit various pan sizes. When the meal is over, the chrome-plated grate removes for simple and quick cleanup.&lt;b&gt;Features&lt;/b&gt;&lt;ul&gt;
&lt;li&gt;Dual Fuel design conveniently burns Coleman Liquid Fuel or unleaded gasoline&lt;/li&gt;
&lt;li&gt;1 gallon of Coleman Liquid Fuel lasts as long as 4.5 cylinders of propane&lt;/li&gt;
&lt;li&gt;Wind Block panels help shield burners from wind and adjust for various pan sizes&lt;/li&gt;
&lt;li&gt;Band-a-Blu burners for reliable cooking power&lt;/li&gt;
&lt;li&gt;All Season Strong technology provides reliable operation in all weather conditions&lt;/li&gt;
&lt;li&gt;14,000 total BTUs of cooking power&lt;/li&gt;
&lt;li&gt;Fits two 10 pans at the same time&lt;/li&gt;
&lt;li&gt;Durable, chrome-plated grate is removable for easy cleaning&lt;/li&gt;
&lt;li&gt;Lasts up to 2 hours with both burners on high on 2.5 pints of Coleman &lt;/li&gt;
&lt;li&gt;Liquid Fuel or unleaded gasoline (both sold separately)&lt;/li&gt;
&lt;li&gt;Perfect for camping, hunting, tailgating and other outdoor occasions&lt;/li&gt;
&lt;li&gt;Filtering funnel included&lt;/li&gt;
&lt;li&gt;5-year limited warranty&lt;/li&gt;
&lt;li&gt;Made in the USA&lt;/li&gt;
&lt;/ul&gt; &lt;!--- cis:y4w2Om4GJ5A= ---&gt;Coleman 2 Burner Dual Fuel Stove&lt;p&gt;&lt;u&gt;Condition&lt;/u&gt; : This item is brand new, unopened and sealed in its original factory box.&lt;/p&gt;

